import React, { useContext, useEffect } from "react";
import { UsersContext } from "./apk";

export default function Read({users}){
    const context = useContext(UsersContext);
    
    useEffect(() => {
        console.log("testing de context", context.usersd);
    }, [context.le]);
  return(
    <>
  
    <table class="table table-striped table-hover table-border mt-4 text-center" >
        <thead>
            <tr>
                <th scope="col">id</th>
                <th scope="col">fullname</th>
                <th scope="col">country</th>
            </tr>
        </thead>
        <tbody>
        {context.usersd.lenth>0? context.usersd.map((user,key)=>(
 <tr key={key}>
 <td scope="row">{user.id}</td>
 <td>{user.fullname}</td>
 <td>{user.country}</td>
</tr>
        )):<h1 colspan="3">no users</h1>}
           
          
        </tbody>
    </table>
    </>
  )
};
